import { Layout } from "antd";
import AppContent from "./components/AppContent";
import AppSidebar from "./components/AppSidebar";

function App() {
  return (
    <div>
      <Layout>
        <AppSidebar />
        <Layout>
          <AppContent close />
        </Layout>
      </Layout>
    </div>
  );
}

export default App;
